import './style.css'

function go() {
  alert("hi")
}


class App extends React.Component {
  state = {
    hi: "k"
  }

 change = (e) => {
  this.setState({hi: e.target.value})
  if (e.target.value === "hi") {
    for (let i = 0; i < 4; i++) {
      if (i === 3) {
        alert('good')
      }
    }
  } else if (e.target.value === "bye") {
    alert("bad")
    e.target.value = ""
  }
}

render() {

  return (
    <div classname="back">



      <div className='back'>
        <center>


            <title>Sign In</title>



          <body id='back'>

            <section class="overlay">
              <h1 id="first">Sign Up</h1>
              <p id="create">Create an account:</p>
              <form action="submission.html" method="GET">
                <label for="usernames" id="username">Username:</label>
                <br />
                <input id="usernames" name="username" type="text" minlength="3" maxlength="15" />
                <br />
                <label for="usernames" id="username">Password:</label>
                <br />

                <input id="usernames" name="pw" type="password" required minlength="8" maxlength="30" />
                <br /> <br />
                <input id="cursor" type="submit" value="submit" onClick={go} />

                <input type="text" name="text" value={this.state.hi} onChange={this.change} />
              </form>

            </section></body></center>
        <center>
          <br />
          <br />
          <br />
          <br />
          <br />
          <br />
          <br />
          <br />

          <h1 id='create'>

    </h1>
          <img src="https://media.wired.com/photos/5d5ec4d7a9558100099f379e/master/w_582,c_limit/Gear-Razer-blade-pro-17-source-razer-FATA.jpg"
            alt="Laptop"
            height="400"
            width="600" />
        </center>
        <h1 id="big">h</h1>
      </div>
  </div>
  )
}
}
export default App;
